import React from 'react';
import Head from 'next/head';
import AppLayout from '../components/AppLayout';
import { Typography, Divider } from 'antd';

const { Title, Paragraph, Text, Link } = Typography;
const About = () => {

    return (
        <AppLayout>
            <Head>
                <title>About | ymillonga</title>
            </Head>
            <Typography>
                <Title>소개글(Introduction)</Title>
                <Paragraph>
                    탱고 들어보셨나요? 영화나 드라마 배경음악으로 한 번쯤 들어봤을 그 정열의 <Link href="https://ko.wikipedia.org/wiki/%ED%83%B1%EA%B3%A0_%EC%9D%8C%EC%95%85">탱고 음악</Link>에 맞추어 추는 춤을 일컬어 또한 <Link href="https://namu.wiki/w/%ED%83%B1%EA%B3%A0">탱고</Link>탱고라고 부른답니다.<br />
                     탱고는 전세계에 가장 널리 퍼져있는 소셜댄스입니다. 파트너와 함께 호흡을 맞춰 춤이라 탱고는 <Text strong>‘네 개의 다리, 하나의 심장이 추는 춤’</Text>이라고 불리기도 해요.
                    아르헨티나가 고향인 이 춤은 매력적인 탱고음악에 맞추어 춤추는 상대와 교감하는 경이로운 경험을 선사하기에 전세계적으로 사랑받고 있답니다.<br />
                    <Link href="https://ko.wikipedia.org/wiki/%EB%B0%80%EB%A1%B1%EA%B0%80">밀롱가(Milonga)</Link>는 이런 탱고를 즐기기 위해 사람들이 모이는 장소 및 시간을 의미합니다.

    </Paragraph>
                <Title level={2}>Y Millonga은 탱고인들을 위한 Sns입니다.</Title>
                <Paragraph>
                    <blockquote>
                        <Text strong>탱고는 상상력의 산물</Text>이라 봐요.<br />
                            자신이 움직이는 모습을 거울없이도 상상할 수 있고,<br />
                            상대방의 마음 속을 상상해 볼 수 있고,<br />
                            춤추는 상대방과의 분위기를 상상해볼 수 있고,<br />
                            이것이 왜 즐거운지 상상해 낼 수 있다면,<br />
                            탱고는 당신의 인생에 무엇보다 값진 선물이 될거에요.<br />
                    </blockquote>
                    <Text style={{ float: 'left' }} type="secondary"><Link href="https://cafe.naver.com/useserver">출처 보러가기</Link></Text>
                </Paragraph>

            </Typography>
        </AppLayout>

    );
};

export default About;
